import React, {Component} from 'react';

import Wrapper from './Wrapper';
import About from '../components/About';
import Help from '../components/Help';
import Home from '../components/Home';

class App extends Component {
    render(){
        return(
            <Wrapper>
                <Home />
                <About />
                <Help />
            </Wrapper>
        )
    }
}

export default App;
